# 暂时并没有解决该密码的解密处理。


# 为了更加贴近语法逻辑就有了下面的函数
# 可以从 [+!+[]+[]] 中找到最大的中括号并且收集匹配到的内容
def findall_middle_brackets(string, leftright='[]', force=True):
    left, right = leftright
    s = string
    p = {}
    l, r = 0, 0
    q = s.find(left)
    while True:
        c = []
        if q == -1: break
        for idx,i in enumerate(s[q:]):
            if i == left:  c.append(left)
            if i == right: c.pop()
            if len(c) == 0:
                l, r = q, q + idx + 1
                p[(l, r)] = s[l:r]
                q = s.find(left, r)
                break
        if len(c) > 0:
            if force: return p
            raise KeyError('unparse in index:{}'.format(l))
    return p

def parse(string):
    q = [
        ["+!+[]", "+1"],
        ["+!![]", "+1"],
        ["+![]",  "+0"],
        ["+[]", "+0"],
        ["!+[]", "1"],
        ["!![]", "true"],
        ["![]", "false"],
        ["[][[]]", "undefined"],
        ["[]+[]", "''"],
        ["[+!+[]]+[+[]]", "10"] # 这里并不通用
    ]
    p = []
    f = lambda i: ''.join(['\\'+j if j in r'*.?+$^[](){}|\/' else j for j in i])
    def _parse_first(string, ls):
        s = string
        for a, b in ls:
            v = re.findall(r'^\+?'+f(a), s)
            if v:
                p.append(v[0])
                return re.sub(r'^\+?'+f(a), '', s)
        return s
    def _parse_other(string, ls):
        s = string
        p = []
        t = True
        while t:
            for a, b in q:
                if s and s[0] not in '+![]()':
                    p.append(s[0])
                    s = s[1:]
                    break
                v = re.findall(r'^\+?'+f(a), s)
                if v:
                    s = re.sub(r'^\+?'+f(a), '', s)
                    t = True
                    p.append(v[0])
                    break
                t = False
        k = dict(ls)
        for i in range(len(p)):
            if p[i] in k:
                p[i] = k[p[i]]
        print(p)
        return ''.join(p)

    s = string[1:-1]
    s = _parse_other(s, q)
    try:
        print(s)
        s = str(eval(s))
    except:
        pass
    return string[0] + s + string[-1] # 括号或中括号

def replace_func_brackets(string):
    s = string
    if s == '[]': return s
    return parse(s)







# 针对上面的函数的增强，可以对获取到的数据进行函数替换处理
# 后续需要考虑改成深度迭代，目前这种暂时还不能解决各种问题
def sub_middle_brackets(string, func, leftright='[]',force=True):
    s = string
    d = findall_middle_brackets(string, leftright)
    k = sorted(d)
    ll, rr = 0, len(s) + 1
    if k and func:
        q = [ll]
        for l,r in k:
            q.append(l); q.append(r)
        q.append(rr)
        e = {}
        w = {}
        for i in range(len(q) - 1):
            k, v = (q[i], q[i+1]), s[q[i]:q[i+1]]
            if i%2 == 0: e[k] = v
            if i%2 == 1: w[k] = v
        for i in w: w[i] = func(w[i])
        e.update(w)
        k = sorted(e)
        r = ''.join([e[i] for i in k])
        return r

import re
# 小括号的处理可以直接用正则处理
def sub_parentheses(string, replace_func_brackets):
    s = string
    s = re.sub(r'\([^\(\)]+\)', lambda i:replace_func_brackets(i.group(0)), s)
    return s





